import React from "react";
import { Link } from "react-router-dom";

const Navbar = () =>{
    return (

        <div className="">
            <ul>
                <li><Link to ="/socials" >About Me</Link></li>

                <li><Link to="/projects">Projects</Link></li>
                <li><Link to="/skills">Skills</Link></li>
            </ul>
        </div>
    )
}
export default Navbar
